import { useState, useEffect, useTransition } from "react";
import { read, utils } from "xlsx";
import { Table } from "reactstrap";

import { HEADERS } from "../utils/constants";

// import XLFile from "../data/77-Jamnagar-Rural -Data.xlsx";
import XLFile from "../data/data.xlsx";

const ExlReader = () => {
	const [result, setResult] = useState([]);
	const [isPending, startTransition] = useTransition();

	const getData = async () => {
		const file = await (await fetch(XLFile)).arrayBuffer();
		const wb = read(file);
		const ws = wb.Sheets[wb.SheetNames[0]];
		const data = utils.sheet_to_json(ws);
		console.log(data);
		setResult(data);
	};

	useEffect(() => {
		startTransition(() => {
			getData();
		});
	}, []);

	return (
		<div>
			<h5>77 - Jamnagar Rural</h5>
			<Table className="table table-bordered" size="sm">
				<thead>
					<tr>
						{HEADERS &&
							HEADERS.map((item, index) => {
								return <th key={index}>{item}</th>;
							})}
					</tr>
				</thead>
				<tbody>
					{result &&
						result.map((item, index) => {
							return (
								<tr key={index}>
									<td>{item.PART_NAME_EN}</td>
									<td>{item.PSBUILDING_NAME_EN}</td>
									<td>{item.SECTION_NAME_EN}</td>
									<td>{item.FM_NAME_EN}</td>
									<td>{item.LASTNAME_EN}</td>
									<td>{item.RLN_FM_NM_EN}</td>
									<td>{item.RLN_L_NM_EN}</td>
									<td>{item.GENDER}</td>
									<td>{item.AGE}</td>
									<td>{item.PIN_CODE}</td>
								</tr>
							);
						})}
				</tbody>
			</Table>
		</div>
	);
};

export default ExlReader;
